import React from 'react';
import './About.css';
import profilePic from '../assets/profile.jpg';

const About = () => {
  return (
    <section id="about" className="about-section">
      <img src={profilePic} alt="Profile" className="profile-pic" />
      <div className="about-content">
        <h2>Hi, I'm Dilara!</h2>
        <p>I'm a 3rd year CS and Econ student at Yale passionate about simplifying life using technology. From analyzing urban mobility data to designing femtech products for during my internship, I enjoy tackling challenges that combine creativity, technology, and impact.</p>
        <p>Some days you’ll catch me deep in code, other days poring over datasets or perfecting a product design, but every day I’m driven by ambition, curiosity, and a love for turning ideas into things people actually want to use. When I’m not geeking out over tech, you’ll find me dancing, brainstorming, or trying to make life a little better—one project at a time.
</p>
        <div className="social-links">
          <a href="https://www.linkedin.com/in/handan-dilara-b%C4%B1kmaz-7b4367174/" target="_blank" rel="noopener noreferrer">LinkedIn</a>
          <a href="https://github.com/dilarabikmaz" target="_blank" rel="noopener noreferrer">GitHub</a>
          <a href="mailto:handandilara.bikmaz@yale.edu">Email</a>
        </div>
      </div>
    </section>
  );
};

export default About;
